import React from 'react';
import "./style.css";
import Button from 'react-bootstrap/Button';

export default function Project(props) {


    return (
        <div className="project-component">
            <div className="individual-component">
                <h1>{props.title}</h1>
                <Button 
                    id="project button"
                    as="a"
                    variant="info"
                    href="https://www.google.com"
                    target="_blank"
                >More</Button>
            </div>
        </div>
    );
}
